import React, { Component } from 'react';

class Navbar extends Component {
    state = {
    }

    render() {
        return (
            <nav >
                <a>indigo</a>

                <div>
                    <ul>
                        <li>
                            <a>Home <span>(current)</span></a>
                        </li>
                        <li>
                            <a>About Us </a>
                        </li>
                        <li>
                            <a>Contact Us </a>
                        </li>

                    </ul>
                </div>
            </nav>
        );
    }

}

export default Navbar;
